import React from 'react'
import { useGlobalContext } from './context'

const Movies = () => {
  const { movie } = useGlobalContext();
  return (

    <div>
     {movie?.map((search) => {
      return (
        <div>
          <h2>{search.Title}</h2>
        </div>
      );
    })}
    </div>
  );
};

export default Movies;
